import React from "react";
import "../assets/css/Error.css";
import Img2623 from "../assets/img/Grupo_2623.png";
import Img3455 from "../assets/img/Grupo_3455.png";

function Error() {
  return (
    <div className="ErrorBody">
      <div className="Master">
        <div className="Contenido">
            <br/>
          <h1>¡YA CASI SE SECA EL PISO!</h1>
          <p>
            Danos unos minutitos más, mientras el bichito del aseo termina de
            dejar bien pispo el laboratorio. Tú sabes, primero muertos que mal
            trapeado.
          </p>
          <div>
            <img src={Img2623} alt="" />
            <img src={Img3455} alt="" />
          </div>
        </div>
      </div>
    </div>
  );
}

export default Error;
